INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/In-Ear-Headset/Jabra Elite 4 Active.webp;', 'Jabra Elite 4 Active', 'https://www.amazon.de/Jabra-Active-Bluetooth-Earbuds-Ger%C3%A4uschunterdr%C3%BCckung-Schwarz/dp/B09KNPZB1N/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2VUI7OP3EYN4G&keywords=Jabra+Elite+4+Active&qid=1667162323&qu=eyJxc2MiOiIxLjI4IiwicXNhIjoiMC43OCIsInFzcCI6IjAuNzkifQ%3D%3D&sprefix=%2Caps%2C78&sr=8-1', '114,99', 4.4, 922, 0, 'black;Jabra;Erwachsener;Im Ohr;Kabellos;Gummi;Hoher Tragekomfort mit sicherer Passform: Langlebige Ohrhörer für einen aktiven Lifestyle - mit sicherem aktiven Halt und flügellosem ergonomischem Design konzipiert - IP57 wasser- und schweißfest|Innovative Geräuschregulierung: 4 Mikrofone sorgen für klare Gespräche unterwegs - mit der anpassbaren HearThrough-Technologie Umgebungsgeräusche hören oder für vollen Fokus mit ANC unterdrücken|Individuell einstellbarer Equalizer und Bassverstärkung für starken Sound - Kopfhörer auch einzeln im Mono-Modus nutzbar - bis zu 7 Std Akkulaufzeit, bis zu 28 Std mit Ladecase, mit Schnellladeoption|Mittels Bluetooth 5.2. mit Google Fast Pair verbinden, Musik mit Spotify-Wiedergabe auf Tastendruck abspielen und Alexa (Android 6.0 oder neuer), Siri oder Google Assistant mit der Stimme aktivieren|Lieferumfang: 1x Jabra Elite 4 Active In Ear Bluetooth Kopfhörer, Ladecase, EarGels in 3 Größen, USB-C- Kabel, 5 g, Schwarz, praktische „frustfreie Verpackung“: nachhaltige, verpackungsmüllarme Box|2 Jahre Garantie - Registrierung erforderlich');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/In-Ear-Headset/Panasonic RP-HTX20BE-K.webp;', 'Panasonic RP-HTX20BE-K', 'https://www.amazon.de/Panasonic-RP-HTX20BE-K-Akkulaufzeit-Quick-Charge-Sprachsteuerung-Schwarz/dp/B07NN4C977/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=QQJG6DT3ECG2&keywords=Panasonic+RP-HTX20BE-K&qid=1667162329&sprefix=%2Caps%2C76&sr=8-1', '45,41', 3.4, 99, 0, 'black;Panasonic;Erwachsener;Im Ohr;Kabellos;Aluminium;Kompakter Bluetooth Kopfhörer – Die Panasonic In-Ear Ohrhörer ermöglichen großen Musikgenuss im kleinen Format|In-Ear mit Mikrofon und Sprachsteuerung – Freihändige Bedienung grundlegender Telefon- und App-Funktionen|Panasonic Bluetooth Kopfhörer mit langer Akkulaufzeit und Quick-Charge (15 Min. laden für 80 Min. Laufzeit) – Bis zu 8,5 Stunden Hörvergnügen|In-Ear Ohrhörer mit hochwertigem Design – Textilkabel und Metallapplikationen verleihen dem Bluetooth In Ear Kopfhörer das gewisse Extra|Fester Sitz auch bei starken Bewegungen dank ergonomischem Design - Auswechselbarer Pass-Stücke (S/M/L)');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/In-Ear-Headset/Linklike In-Ear-Kopfhörer mit Kabel.webp;', 'Linklike In-Ear-Kopfhörer mit Kabel', 'https://www.amazon.de/Linklike-Kopfh%C3%B6rer-Ohrh%C3%B6rer-Headphone-Kompatibel-Schwarz/dp/B07V2316BG/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=16VHQTQJ8UXWC&keywords=Linklike+In-Ear-Kopfh%C3%B6rer+mit+Kabel&qid=1667162335&qu=eyJxc2MiOiIwLjYxIiwicXNhIjoiMC40NCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=linklike+in-ear-kop%2Caps%2C84&sr=8-3', '25,99', 4.2, 4697, 0, 'black;Linklike;Erwachsener;Im Ohr;Kabelgebunden;Aluminiumlegierung;🎻[Hochauflösender Sound - QUAD Membran &amp; 8D Luftstromtechnik]: Wenn du Songs wie die von Hotel California spielst, gibt es dir das Gefühl, dort zu sein. Linklike Kopfhörer angenommen exklusive QUAD carbon Fiber mycelium Membranen und air-flow Technologie (gibt die sound Wellen Reisen durch die Ohrhörer bis zu 8x mehr Raum), erbessert den Bass und das Klopfgefühl des Trommelfells erheblich und und bietet einen kraftvolleren und detailreicheren Klang, der Live-Musik authentisch wiedergeben kann.|🥁[Kraftvolle Tiefe Bässe - 4 Dynamische Treiber Einesetzt]: So können Sie Instrumentenklänge und Gesang deutlich spüren. Jedes in-ear Headset ist mit zwei dynamischen Treibern(14,2 mm + 6,5 mm) und einer innovativen schallabsorbierenden Öffnung ausgestattet, die für eine perfekte Klangbalance aus kraftvollen Bässen, fesselnden Mitten und klaren, detaillierten Höhen sorgen.|🎤[Befreien Sie Ihre Hand - MEMS-Mikrofon &amp; Fernbedienung]Sie müssen Ihr Telefon nicht mehr aus der Tasche nehmen, denn mit dem eingebauten Kopfhörer Mikrofon und den Fernbedienung können Sie ganz einfach Anrufe entgegennehmen und zum nächsten Lied wechseln. Das MEMS-Mikrofon und die schallabsorbierenden Löcher sorgen(Diese reduzieren die Außengeräusche) für eine hervorragende Gesprächsqualität - perfekt für Busse, beim Laufen, Wandern und mehr. Sie können überall Musik hören und Anrufe tätigen.|👂 [Bequeme Passform - Keine Druckschmerzen im Gehörgang]: Der Linklike wurde ergonomisch gestaltet, damit der earphones bequem und schmerzfrei im Gehörgang getragen werden kann und sind damit für mehr Menschen geeignet als alle anderen In-Ear-Kopfhörer mit kabel. Mit einem Durchmesser von nur 6 mm werden die headphones Ihren Gehörgang nicht quetschen oder beschädigen, wenn Sie mehr als 12 Stunden auf der Seite schlafen, und bieten so langfristigen Komfort und Schutz für Ihre Ohren.|😊[Was Du Bekommst - Schöne Geschenkbox-Verpackung]: 1* Komfortable Kopfhörer, 2* Silikon-Ohrstöpsel, 1* Ohrhörer Säckchen, 1* Bedienungsanleitung. 👉So wie wir uns um die Qualität unserer earbuds kümmern, so kümmern wir uns auch um das Kundenerlebnis und mehr als 97% der Kunden bestätigen, dass sie viel Freude bereiten. ✎ ✉ Bei Kopfhörerproblemen kontaktieren Sie uns bitte über Amazon Message Center. 24/7 365 Support, Wir stehen Ihnen beim ersten Mal zur Verfügung.');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/In-Ear-Headset/Klim Fusion.webp;', 'Klim Fusion', 'https://www.amazon.de/KLIM-Fusion-Audio-Kopfh%C3%B6rer-Ear-Kopfh%C3%B6rer-Schwarz/dp/B0736SCQ4X/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=72PM6G8NEXSZ&keywords=Klim+Fusion&qid=1667162340&qu=eyJxc2MiOiIxLjA2IiwicXNhIjoiMS4xMiIsInFzcCI6IjEuMTkifQ%3D%3D&sprefix=linklike+in-ear-kopfh%C3%B6rer+mit+kabel%2Caps%2C71&sr=8-3', '19,97', 4.1, 45218, 0, 'black;KLIM;Erwachsener;Im Ohr;Kabelgebunden;-;BEQUEM. KLIM Fusion Kopfhörer sind mit Memory Foam ausgestattet, das sich perfekt an die Form Deines Ohres anpasst und diese beibehält. Manche Menschen bevorzugen Standard In-Ear-Aufsätze, deswegen bieten wir 3 zusätzliche Paare in allen Größen. Die robusten Kopfhörer sind magnetisiert, so dass Du sie bequem um den Hals tragen und Kabelverwicklungen vermeiden können.|HOHE AUDIOQUALITÄT. Sicherlich bekommst Du bei 100 € Kopfhörern eine bessere Audioqualität. Aber KLIM Fusion bietet in dieser Preisklasse die absolut beste Soundqualität. Wenn Du eine hohe Audioqualität zu einem guten Preis suchen, wirst Du nirgends ein besseres Preis-Leistungs-Verhältnis finden. Die In-Ear Kopfhörer verfügen über ein eingebautes Kopfhörer Mikrofon und einen stufenlosen Lautstärkeregler. Genieße Deine Musik, ohne dafür Unsummen ausgeben zu müssen.|MEMORY FOAM. Total innovativ - diese In-Ear-Kopfhörer haben einen zweifachen Vorteil: 1) sie sind sehr bequem und passen sich in Deinem Ohr perfekt an, und 2) sie blocken Außenlärm komplett ab. Wenn Du sie erst mal trägst, gibt es nur Dich und Deine Musik. Die KLIM Fusion sind mit Magneten ausgestattet die sie zusammenhalten, Sie werden nie wieder verdrehte Kopfhörer erleben. Du kannst sie auch hinter Deinem Nacken verbinden und sie bequem erreichen.|SORGSAM GEARBEITETES DESIGN. KLIM Fusion kommt in einem selbstbewussten Gamer-Look. Bei KLIM bevorzugen wir ein auffälliges und trotzdem minimalistisches Design; wenn Du danach suchst sind die In Ear Kopfhörer genau richtig für Dich. Wir haben auch eine elegante Tragetasche beigefügt, damit Deine Kopfhörer jederzeit sicher sind. BONUS: Du erhälst nach dem Kauf das gratis E-Book „7 Tipps, um Deinen Computer länger am Laufen zu halten und die Performance zu maximieren“ per E-Mail.|ROBUST GEBAUT. Das Problem mit Kopfhörern: oft funktionieren sie nur wenige Monate. Ganz ehrlich: wenn es um Elektronik geht, wird es immer Mängel geben. Wir haben uns bemüht, ein langlebiges Produkt zu bauen – 98,5% unserer Kopfhörer funktionieren nach 6 Monaten und 97% sogar nach einem Jahr immer noch. Wahrlich ein risikoloser Kauf.');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/In-Ear-Headset/Ludos Kopfhörer In-Ear-Wired-Ohrhörer.webp;', 'Ludos Kopfhörer In-Ear-Wired-Ohrhörer', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToyMzEyNDkxMDA0NjExMzc2OjE2NjcxNjIzNTM6c3BfYXRmOjIwMDI3MzUwNDU2NDA2OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FLUDOS-Clamor-Kopfh%25C3%25B6rer-Premium-Audioqualit%25C3%25A4t-Lautst%25C3%25A4rkeregler-Schwarz%2Fdp%2FB074M7FJDW%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D2Y5UOCLBR8YDC%26keywords%3DLudos%2BKopfh%25C3%25B6rer%2BIn-Ear-Wired-Ohrh%25C3%25B6rer%26qid%3D1667162353%26sprefix%3Dludos%2Bkopfh%252Caps%252C95%26sr%3D8-2-spons%26psc%3D1', '19,97', 4.2, 35967, 0, 'black;LUDOS;Erwachsener;Im Ohr;Kabelgebunden;Metall;❇️ 【PREMIUM AUDIO-QUALITÄT】Heutzutage variiert die Soundqualität im Bereich der Unterhaltungselektronik besonders stark. Der In Ear Kopfhörer LUDOS CLAMOR verfügt über eine optimierte Audioausgabe und bietet daher maximalen Hörgenuss – ein einzigartiges, intensives Klangerlebnis. Dieses Produkt ist ein Meisterwerk der Technik.|❇️ 【NEUARTIGER MEMORY FOAM UND MAXIMALER KOMFORT】Vor einigen Jahre wurde Memory Foam für Headsets und Kopfhörer entdeckt, da dieser einen höheren Tragekomfort garantiert. Unsere neuen Ohrhörer sind sehr angenehm zu tragen, bis zu 40 Prozent verschleißfester und ihr Design basiert auf umfangreichen Studien.|❇️ 【EINE ORDENTLICHE PORTION BASS】Bei uns wird „Bass“ großgeschrieben, deshalb haben wir bei unseren Ohrhörern auf hochwertige Treiber und satte Bässe sowie eine perfekte Mischung aus Mitten und Höhen geachtet. Aus diesem Grund geht der beeindruckende Sound noch „tiefer“. Wir bieten hohe Qualität zu einem fairen Preis.|❇️ 【NEUES DESIGN UND NEUE MATERIALIEN】Das Design der In Ear Kopfhörer LUDOS CLAMOR ist modern und kann sich sehen lassen, egal wo: ob im Büro, am Strand, beim Pendeln oder einfach zu Hause beim Entspannen. Sie müssen beim Genuss Ihrer Lieblingsmusik von nun an nicht mehr auf Komfort verzichten. Für diesen eleganten Kopfhörer In Ears haben wir die besten Materialien ausgewählt, einschließlich eines hochresistenten Kabels, das zudem eine angenehme Haptik hat.|❇️ 【E-BOOK UND KUNDENSERVICE RUND UM DIE UHR】Beim Kauf des Kopfhörers erhalten Sie per E-Mail unser E-Book mit spezifischen Tipps für die Nutzung Ihrer neuen Kopfhörer. Sie können sich jederzeit an uns wenden. Wir sind gerne für Sie da und werden immer versuchen, Ihr Anliegen schnellstmöglich zu lösen. Kundenzufriedenheit hat bei uns oberste Priorität, das haben wir uns auf die Fahnen geschrieben.');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/In-Ear-Headset/JBL T110.webp;', 'JBL T110', 'https://www.amazon.de/JBL-T110-Pure-Bass-in-Ear-Kopfh%C3%B6rer-Blau/dp/B06VWPVBMH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3L0J0B93ILIM8&keywords=JBL+T110&qid=1667162358&qu=eyJxc2MiOiIyLjU0IiwicXNhIjoiMS42OSIsInFzcCI6IjEuMzcifQ%3D%3D&sprefix=ludos+kopfh%C3%B6rer+in-ear-wired-ohrh%C3%B6rer%2Caps%2C73&sr=8-3', '9,99', 4.3, 2600, 0, 'blue;JBL;Erwachsener;Im Ohr;Kabelgebunden;-;JBL Reiner Bass-Klang. Seit über 60 Jahren entwickelt JBL präzisen, beeindruckenden Klang für große Veranstaltungsorte auf der ganzen Welt. Diese Kopfhörer geben denselben JBL-Sound wieder und liefern sowohl tiefe als auch kraftvolle Bässe.|Fernbedienung mit 1 Taste und Mikrofon. Steuern Sie die Musikwiedergabe mit einer praktischen 1-Tasten-Fernbedienung. Eingehender Anruf? Beantworten Sie ihn unterwegs mit dem eingebauten Mikrofon|Langlebiges Flachkabel, das sich nicht verknotet.|Technische Daten: Stecker: 3,5&nbsp;mm. Dynamischer Treiber: 9&nbsp;mm. Frequenzbereich: 20&nbsp;Hz–20&nbsp;kHz.|Lieferumfang: 1 Paar T110 Kopfhörer. Ohrstöpsel (Größe S, M, L). Warnhinweis. Karte');
INSERT INTO `in-ear-headset` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/In-Ear-Headset/Sony MDR-EX110APB.webp;', 'Sony MDR-EX110APB', 'https://www.amazon.de/Sony-FBA_MDREX110APB-CE7-MDR-EX110APB-In-Ear-Kopfh%C3%B6rer-schwarz/dp/B00I3LUUIU/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=208652BM4EMYS&keywords=Sony+MDR-EX110APB&qid=1667162364&qu=eyJxc2MiOiIxLjEwIiwicXNhIjoiMC41MyIsInFzcCI6IjAuNjEifQ%3D%3D&sprefix=jbl+t110%2Caps%2C73&sr=8-1', '19,90', 4.3, 6307, 0, 'black;Sony;Alle Altersgruppen;Im Ohr;Kabelgebunden;Magnet;In-Ohr-Polsterung reduziert Umgebungsgeräusche|Headsetfunktion dank integriertem Mikrofon|Integrierte Fernbedienung ermöglicht das Annehmen von Anrufen sowie Steuerung der Musik|Starker Neodymium Magnet sorgt für satte Bässe und voluminösen Klangcharakter|Lieferumfang: Sony MDREX110APB.CE7 In-Ear-Kopfhörer schwarz');
